import React from "react";
import './home.css';
import axios from 'axios';

function Home() {
    return (
        <div className="home">
          <header id="header">
            <div className="intro">
                <div className="overlay">
                    <div className="container">
                        <div className="row">
                            <div className="col-md-8 col-md-offset-2 intro-text">
                                <h1>Houses & Appartments<br></br>
                                For Rentals</h1>
                                <h2>Find your dream home here...!!</h2>
                                <li className='login-btn'><button onClick={() => { /* Handle logout if needed */ }}>Login</button></li>

                            </div>
                        </div>
                    </div>
                </div>
            </div>
          </header>
          <div className="cont">
            <p>Here you will see your dream houes.
            </p>

          </div>
        </div>
    );
}

export default Home;
